import { AUTHENTICATE_USER, SIGN_OUT } from "./types";

export const signOut = (id) => {
    return {
        type: SIGN_OUT,
        id
    };
}

export const authenticateUser = (id) => {
    return {
        type: AUTHENTICATE_USER,
        id
    };
}
